define(["underscore","Magento_PageBuilder/js/config"],function(_underscore,_config){var allowedParents={};function generateAllowedParents(){_underscore.values(_config.getConfig("content_types")).forEach(function(contentType){allowedParents[contentType.name]=contentType.allowed_parents.slice();});}
function getContainersFor(contentType){if(allowedParents[contentType]){return allowedParents[contentType];}
return[];}
function getAllowedContainersClasses(contentType,stageId){return getContainersFor(contentType).map(function(value){return"#"+stageId+" .content-type-container."+value+"-container";}).join(", ");}
return{generateAllowedParents:generateAllowedParents,getContainersFor:getContainersFor,getAllowedContainersClasses:getAllowedContainersClasses};});